export const ingredientsMeasuresFunc = (obj) => {
  const objKey = Object.keys(obj)
  const objEntries = Object.entries(obj[objKey][0]);
  const objEntriesFiltered = objEntries.filter((entry) => 
    entry[0].includes('strIngredient') || entry[0].includes('strMeasure'))
      .filter((entryFiltered) => (entryFiltered[1])); 
  console.log(objEntriesFiltered);
  return objEntriesFiltered;
}
